export function Pagination({ datalength, countCurrentPage, paginate }) {
  const pageNumbers = [];
  for (let i = 1; i <= datalength / countCurrentPage; i++) {
    pageNumbers.push(i);
  }
  return (
    <div className="pagination ">
      {pageNumbers.map((elem) => (
        <div>
          <div className="page-item">
            <a className="page-link" href="#" onChange ={() =>paginate}>{elem}</a>
          </div>
        </div>
      ))}
    </div>
  );
}
